import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  display: flex;
  border: 1px dashed white;
`

const Site = styled.a`
  background-image: url('../images/${props => props.name}-w.png');
  width: 40px;
  height: 40px;
  margin: 1rem;
`

export default Media = (props) => {
  return (
    <Container>
      <Site name='linkedin' href='' />
    </Container>
  )
}
